import { useCart } from '../context/CartContext';

const CartOverlay = () => {
  const context = useCart();
  
  if (!context) {
    return <div>Error: Cart context not found</div>;
  }

  const { 
    cart, 
    isCartOpen, 
    setIsCartOpen,
    removeFromCart,
    updateQuantity,
    clearCart,
    getTotal 
  } = context;

  // Debug
  console.log('=== CartOverlay Debug ===');
  console.log('isCartOpen:', isCartOpen);
  console.log('cart length:', cart.length);

  // إذا كانت مغلقة، لا ترجع null - ارجع div فارغ
  if (!isCartOpen) {
    return <div style={{ display: 'none' }} />;
  }

  // يجب تظهر الآن
  return (
    <div 
      className="cart-overlay"
      style={{
        position: 'fixed',
        top: 0,
        left: 0,
        width: '100%',
        height: '100%',
        backgroundColor: 'rgba(0,0,0,0.5)',
        display: 'flex',
        justifyContent: 'flex-end',
        zIndex: 9999
      }}
      onClick={() => setIsCartOpen(false)}
    >
      <div 
        className="cart-added"
        style={{
          width: '400px',
          height: '100vh',
          background: 'white',
          display: 'flex',
          flexDirection: 'column',
          boxShadow: '-5px 0 15px rgba(0,0,0,0.3)',
          zIndex: 10000
        }}
        onClick={(e) => e.stopPropagation()}
      >
        <button
          style={{
            padding: '15px 20px',
            textAlign: 'right',
            fontSize: '24px',
            cursor: 'pointer',
            color: '#333',
            border: 'none',
            background: 'transparent'
          }}
          onClick={() => setIsCartOpen(false)}
        >
          <i className="fa-sharp fa-solid fa-rectangle-xmark"></i>
        </button>

        <h3 style={{ padding: '0 20px', margin: 0 }}>Added to cart</h3>

        <div style={{ flex: 1, overflowY: 'auto', padding: '10px 0' }}>
          {cart.length === 0 ? (
            <p style={{ textAlign: 'center', padding: '20px', color: '#666' }}>
              Your cart is empty
            </p>
          ) : (
            cart.map(item => (
              <div key={item.id} style={{ padding: '15px 20px', borderBottom: '1px solid #f0f0f0', display: 'flex', gap: '15px' }}>
                <img src={item.image} alt={item.name} style={{ width: '80px', height: '80px', objectFit: 'cover' }} />
                <div style={{ flex: 1 }}>
                  <h4 style={{ margin: 0 }}>{item.name}</h4>
                  <p style={{ margin: '5px 0', color: '#088178', fontWeight: 'bold' }}>${item.price}</p>
                  <div style={{ display: 'flex', gap: '8px' }}>
                    <button onClick={() => updateQuantity(item.id, item.quantity - 1)}>-</button>
                    <span>{item.quantity}</span>
                    <button onClick={() => updateQuantity(item.id, item.quantity + 1)}>+</button>
                    <button onClick={() => removeFromCart(item.id)} style={{ marginLeft: 'auto', background: '#ff6b6b', color: 'white', border: 'none', padding: '5px 10px', cursor: 'pointer' }}>Remove</button>
                  </div>
                </div>
              </div>
            ))
          )}
        </div>

        {cart.length > 0 && (
          <div style={{ padding: '20px', borderTop: '2px solid #eee', background: '#f9f9f9' }}>
            <h3 style={{ textAlign: 'center', margin: 0 }}>Total: ${getTotal()}</h3>
            <button onClick={clearCart} style={{ width: '100%', padding: '12px', background: '#088178', color: 'white', border: 'none', marginTop: '10px', cursor: 'pointer' }}>Clear cart</button>
          </div>
        )}
      </div>
    </div>
  );
};

export default CartOverlay;
